//import useState hook to create menu collapse state
import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
//import react pro sidebar components
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap/dist/js/bootstrap.bundle'

import "./sidebar.css";


const Header = () => {
  return (
    <>

		<div className="s-layout">
<div className="s-layout__sidebar">
  <a className="s-sidebar__trigger" href="#0">
     <i className="fa fa-bars"></i>
  </a>

  <nav className="s-sidebar__nav">
	<img src="https://yt3.googleusercontent.com/TQr40bktNFSecWvJBOJYYOgfSJN5IaTWDMuF8qPJo4T_8zfiyHsApu6WLk8vHLbSss1Bz8rouA=s900-c-k-c0x00ffffff-no-rj" alt="chattisgarh Forest Department" />
     <ul>
        <li>
           <a className="s-sidebar__nav-link" href="#0">
              <i className="fa fa-home"></i><em>Home</em>
           </a>
        </li>
        <li>
           <a className="s-sidebar__nav-link" href="#0">
             <i className="fa fa-user"></i><em>My Profile</em>
           </a>
        </li>
        <li>
           <a className="s-sidebar__nav-link" href="#0">
              <i className="fa fa-camera"></i><em>Camera</em>
           </a>
        </li>
     </ul>
  </nav>
</div>
<main className="s-layout__content">
  <h1>Full View, Please!</h1>
</main>
</div>
    </>
  );
};

export default Header;
